import React from 'react';

export default function Card (props) {
    return (
        // <div>
        //     <ul>
        //         <li>{props.todo.content}</li>
        //     </ul>
        // </div>
        <div>
            {props.listofTodos.map(todo => {
                return (
                    <ul>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </div>
    );
}
